pragma solidity 0.5.11;

import "@openzeppelin/contracts/ownership/Ownable.sol";
import "@openzeppelin/contracts/lifecycle/Pausable.sol";
import "./ERC777.sol";
import "../core/SponsorWhitelistControl.sol";

interface ICustodian {
    function checkBurnable(
        address token,
        uint256 fee,
        uint256 amount
    ) external view returns (uint256);

    function getProfitWallet() external view returns (address);
}

contract TokenBase is ERC777, Ownable {
    // sponsor address
    SponsorWhitelistControl public constant SPONSOR = SponsorWhitelistControl(
        address(0x0888000000000000000000000000000000000001)
    );

    uint256 burn_cnt;

    event Minted(
        address indexed toAddress,
        uint256 indexed amount,
        address fee_address,
        uint256 fee,
        address defi,
        string tx_id
    );

    event Burnt(
        uint256 indexed amount,
        string toAddress,
        uint256 fee,
        address indexed fromAddress,
        address defi_relayer,
        uint256 burn_cnt
    );

    constructor(
        string memory name,
        string memory symbol,
        address[] memory defaultOperators
    ) public ERC777(name, symbol, defaultOperators) {
        burn_cnt = 0;
        // cfx sponsor
        address[] memory users = new address[](1);
        users[0] = address(0);
        SPONSOR.addPrivilege(users);
    }

    /* ===== Mint & Burn =====*/
    function mint(
        address account,
        uint256 amount,
        address fee_address,
        uint256 fee,
        address defi,
        string memory tx_id
    ) public onlyOwner returns (bool) {
        _onlyNotPaused();
        _mint(_msgSender(), account, amount, "", "");
        if (fee > 0) _mint(_msgSender(), fee_address, fee, "", "");
        emit Minted(account, amount, fee_address, fee, defi, tx_id);
        return true;
    }

    function burn(
        address user_addr,
        uint256 amount,
        uint256 expected_fee,
        string memory addr,
        address defi_relayer
    ) public returns (bool) {
        _onlyNotPaused();
        // get burn fee
        ICustodian custodian = ICustodian(owner());
        uint256 fee = custodian.checkBurnable(
            address(this),
            expected_fee,
            amount
        );
        // burn amount - fee
        _burn(_msgSender(), _msgSender(), amount.sub(fee), "", "");
        // transfer fee to profit wallet
        transfer(custodian.getProfitWallet(), fee);
        emit Burnt(
            amount.sub(fee),
            addr,
            fee,
            user_addr,
            defi_relayer,
            burn_cnt
        );
        burn_cnt += 1;
        return true;
    }
}
